import { Auth0Provider, useAuth0 } from '@auth0/auth0-react';
import React, { useEffect } from 'react';
import { Navigate, Route, BrowserRouter as Router, Routes, useNavigate } from 'react-router-dom';
import './App.css';

// Adjust the path if necessary
import About from './components/About';
import Account from './components/Account';
import Contact from './components/Contact';
import Dashboard from './components/Dashboard';
import FarmersDashboard from './components/FarmersDashboard';
import Home from './components/Home';
import Land from './components/Land';
import MapComponent from './components/MapComponent';
import Sidebar from './components/Sidebar';
import SideHome from './components/SideHome'; // Fix component name case
import SowingForm from './components/SowingForm';

function App() {
  const { isAuthenticated, logout } = useAuth0();
  const navigate = useNavigate();

  // Redirect to the "About" page after login
  useEffect(() => {
    if (isAuthenticated) {
      navigate('/about'); // Redirect to About page if authenticated
    }
  }, [isAuthenticated, navigate]);

  return (
    <div>
      <Routes>
        <Route path="/sidebar" element={<Sidebar />} />
        <Route path="/home" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/register" element={<Account />} />
        <Route path="/showing" element={<SowingForm />} />
        <Route path="/farmersdashboard" element={<FarmersDashboard />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/land" element={<Land />} />
        <Route path="/map" element={<MapComponent />} />
        <Route path="/sideHome" element={<SideHome />} /> {/* Correct component reference */}
        <Route path="/profile" element={isAuthenticated ? <SideHome /> : <Navigate to="/sidehome" />} />
        <Route path="/" element={<Home />} />
      </Routes>

      {isAuthenticated && (
        <button onClick={() => logout({ returnTo: window.location.origin })}>Logout</button>
      )}
    </div>
  );
}

// Wrap App component with Auth0Provider
const Root = () => (
  <Auth0Provider
    domain="dev-0va1gvwgwfk0n27p.us.auth0.com"
    clientId="G4oOtJbNvzl9dn8c4bSdoa5EdZsxoOIk"
    authorizationParams={{
      redirect_uri: window.location.origin
    }}
  >
    <Router> {/* Moved Router here to allow proper routing context */}
      <App />
    </Router>
  </Auth0Provider>
);

export default Root;
